Info Bulan Imunisasi Anak Sekolah

Bulan Imunisasi Anak Sekolah (BIAS) adalah Program Pemerintah yang dilaksanakan diseluruh Indonesia yang bertujuan untuk memberikan kekebalan pada anak usia sekolah dasar dan sederajat terhadap penyakit menular yang bisa dicegah dengan imunisasi seperti Campak, Rubella, Difteri, Tetanus dan Kanker Serviks

Ayo Imunisasi, karena imunisasi merupakan upaya pencegahan yang palik efektif dan terjangkau untuk mendapatkan perlindungan maksimal dari berbagai penyakit menular dengan memberikan “vaksin” sehingga terjadi imunitas (kekebalan) terhadap penyakit tersebut.

Manfaat imunisasi bagi anak jauh lebih besar dibandingkan risiko efek sampingnya. Imunisasi melindungi tubuh anak dari serangan dan ancaman bakteri / virus penyakit tertentu, mencegah anak dari tertular penyakit yang disebabkan oleh bakteri / virus serta meningkatkan kekebalan tubuh terhadap penyakit-penyakit tertentu dan meningkatkan status kesehatan anak yang berdampak pada kualitas tumbuh kembang dan produktivitas sumber daya manusia di masa depan.

